import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function BasicExample() {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        </ul>
      </div>
      </Router>
  );
  function Home(){
    return(
      <div>
        <h2>Home</h2>
      </div>
    )
  }
  function About(){
    return(
      <div>
        <h2>About</h2>
      </div>
    )
  }
  function Dashboard(){
    return(
      <div>
        <h2>Dashboard</h2>
      </div>
    )
  }
}
